import SwiftUI

let pictureArr: [String] = ["data:image/jpeg;base64,",

    "data:image/jpeg;base64,",

    "data:image/jpeg;base64,",
                            
    "data:image/jpeg;base64,",
                        
    "data:image/jpeg;base64,",
                            
    "https://todaysparent.mblycdn.com/tp/resized/2017/06/1200x630/when-your-kid-becomes-a-meme.jpg",
                            
    "data:image/jpeg;base64,"]


class ViewModel: ObservableObject {
    
    @Published var image: Image?
    
    func fetchNewImage() {
        guard let url = URL(string: pictureArr.randomElement()!) else {
            return
        }
        
        let task = URLSession.shared.dataTask(with: url) { data,
            _, _ in
            guard let data = data else { return }
            
            DispatchQueue.main.async {
                guard let uiImage = UIImage(data: data) else {
                    return
                }
                self.image = Image(uiImage: uiImage)
            }
        }
        
        task.resume()
    }
}
struct ContentView: View {
    
    @StateObject var viewModel = ViewModel()
    
    let colorArr: [Color] = [Color.black, Color.green, Color.red, Color.pink, Color.blue, Color.orange]
    
    var body: some View {
        NavigationView {
            VStack {
                
                Spacer()
                
                if let image = viewModel.image {
                    ZStack {
                        image
                            .resizable()
                            .foregroundColor(Color.pink)
                            .frame(width: 200, height: 200)
                            .padding()
                    }
                    .frame(width: UIScreen.main.bounds.width / 1.2,
                           height: UIScreen.main.bounds.width / 1.2)
                    .background(colorArr.randomElement())
                    .cornerRadius(8)
                }
                else {
                    Image(systemName: "photo")
                        .resizable()
                        .foregroundColor(Color.pink)
                        .frame(width: 200, height: 200)
                        .padding()
                }
                
                Spacer()
                
                Button(action: {
                    viewModel.fetchNewImage()
                }, label: {
                    Text("New Meme!")
                        .bold()
                        .frame(width: 250, height: 40)
                        .foregroundColor(Color.white)
                        .background(Color.blue)
                        .cornerRadius(8)
                        .padding()
                })
            }
            .navigationTitle("Random Meme")
        }
    }
}

struct ContentView_Previews: PreviewProvider {
    static var previews: some View {
        ContentView()
    }
}
